import React  from "react";

import styles from "./cardUsuario.css"


export default function CardUsuario (props){
    const u = props.usuario;
    return (
        <div className={styles.cardUsuario}>
            <h2> INFORMACION PRINCIPAL USUARIO </h2>
            <ul>
                <li> {u.username} </li>
                <li> {u.email}</li>
                <li> {u.firstName} </li>
                <li>{ u.lastName }</li>
            </ul>
            <img src={u.image} alt="foto de perfil "></img>
        </div>
    );
}
